import react from "react"

function LoginPage({ usernames }){

  return(
    <div className="loginForm">
      <form>
        <select>
          {usernames.map(username => {
            <option>`${username}`</option>
          })}
        </select>
        <button>Login</button>
      </form>
    </div>
  )
}

export default LoginPage;
